import { StyleSheet, View } from "react-native";

export default function Footer() {

    return (
        <View style={styles.footer}>
            sdsd
        </View>
    );
}
const styles = StyleSheet.create({
    footer: {
        paddingTop: '4vh',
        height: '8vh',
        flex: 1,
        flexDirection: "row",
        flexWrap: "wrap",
        alignItems: "center",
        alignContent: "space-between",
    }
});
